import React, { useState } from 'react';
import Header from './components/Header';
import Hero from './components/Hero';
import BrowseSpaces from './pages/BrowseSpaces';
import './App.css';

function App() {
    const [currentView, setCurrentView] = useState('home');

    const renderCurrentView = () => {
        switch (currentView) {
            case 'browse':
                return <BrowseSpaces setCurrentView={setCurrentView} />;
            default:
                return (
                    <>
                        <Hero setCurrentView={setCurrentView} />
                        <main style={{ padding: '2rem', textAlign: 'center' }}>
                            <h2>Featured Spaces</h2>
                            <p>Discover amazing spaces perfect for your next project</p>
                            <div style={{
                                display: 'grid',
                                gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))',
                                gap: '2rem',
                                marginTop: '2rem'
                            }}>
                                <div style={{
                                    backgroundColor: '#f8f9fa',
                                    padding: '1.5rem',
                                    borderRadius: '8px',
                                    textAlign: 'left'
                                }}>
                                    <h3>Modern Gallery Space</h3>
                                    <p>Perfect for exhibitions and events</p>
                                    <p><strong>$150/day</strong> • Auckland CBD</p>
                                </div>
                                <div style={{
                                    backgroundColor: '#f8f9fa',
                                    padding: '1.5rem',
                                    borderRadius: '8px',
                                    textAlign: 'left'
                                }}>
                                    <h3>Workshop Space</h3>
                                    <p>Ideal for classes and workshops</p>
                                    <p><strong>$80/day</strong> • Ponsonby</p>
                                </div>
                                <div style={{
                                    backgroundColor: '#f8f9fa',
                                    padding: '1.5rem',
                                    borderRadius: '8px',
                                    textAlign: 'left'
                                }}>
                                    <h3>Retail Pop-up</h3>
                                    <p>Great for temporary stores</p>
                                    <p><strong>$200/day</strong> • Newmarket</p>
                                </div>
                            </div>

                            <div style={{ marginTop: '3rem' }}>
                                <button
                                    onClick={() => setCurrentView('browse')}
                                    style={{
                                        backgroundColor: '#667eea',
                                        color: 'white',
                                        padding: '1rem 2rem',
                                        border: 'none',
                                        borderRadius: '8px',
                                        fontSize: '1.1rem',
                                        fontWeight: '600',
                                        cursor: 'pointer'
                                    }}
                                >
                                    View All Spaces
                                </button>
                            </div>
                        </main>
                    </>
                );
        }
    };

    return (
        <div className="App">
            <Header currentView={currentView} setCurrentView={setCurrentView} />
            {renderCurrentView()}
        </div>
    );
}

export default App;
